import React from "react";
import { AppBar, Toolbar, Typography, Button } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { MuiThemeProvider } from "@material-ui/core/styles"; // 追加
import { theme } from "./materialui/theme"; // 追加

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  logo: {
    maxWidth: 60,
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
  // appBar: {
  //   color: Colors.common.white,
  // },
}));

const Header = () => {
  const classes = useStyles();

  return (
    <div>
      <MuiThemeProvider theme={theme}>
        <AppBar className={classes.appBar} position="static">
          <Toolbar>
            <img src="./logo_Dabyss.png" className={classes.logo} />
            <Typography variant="h6" className={classes.title}>
              MinigameDabyss
            </Typography>
            <Button color="inherit">ゲーム一覧</Button>
            <Button color="inherit">ブログ</Button>
            <Button color="inherit">お問い合わせ</Button>
          </Toolbar>
        </AppBar>
      </MuiThemeProvider>{" "}
    </div>
  );
};

export default Header;
